INSERT INTO `universities` (`id`, `university_name`, `description`, `logo`, `location`, `rating`, `student_count`, `email`, `phone`, `website`, `slug`, `country_id`, `created_at`, `updated_at`) VALUES
(1, 'American University Of Cyprus', 'Welcome to the American University of Cyprus (AUC) family. You our valued students will spend your student years in KAU?s natural laboratory environment see your achievements day by day, and become more aware of the correctness of your choice.<br><br>By studying in the Turkish Republic of Northern Cyprus (TRNC), you will also be taking part in a world university. You will sail to new horizons with the application of a free education system at KAU. The mission of KAU is to shine another light of science on Nicosia, the city of lights, to provide high quality education and training to contribute with scientifically based knowledge through research and publication activities, to share its results with the society locally and internationally and to serve them.<br><br>Located in the capital Nicosia, KAU is an international university with a vision that is both in line with the historical characteristics and texture of the city and shapes the future.', 'data:image/png;base64,', '', 0, 0, '', '', '', 'auoc', 247, NULL, NULL),
(2, 'ARUCAD', 'ARUCAD, Founded in North Cyprus in 2017, Arkin University of Creative Arts and Design (ARUCAD) is a thematic art university that is wholly dedicated to the fields of art design and communication. ARUCAD?s goal is to become one of the most reputable universities in art education, whereby its students continuously improve their creative productivity through interdisciplinary and cross-cultural programs based on traditional, modern and contemporary art teaching and learning whilst adhering to the inseparable link of theory and practice.<br><br>Respect for ecological, recycling and health and safety issues, in addition to equality in gender, racial and religious values will be practiced throughout the teaching/learning environment. ?Learning whilst producing, producing whilst learning? is an education model that aims to connect experience, critical thinking and practice in order to generate greater- thinking artists and designers.', 'data:image/png;base64,', 'NO:11 SAIR NEDIM SOKAK, Girne, Turkish Republic Of Northern Cyprus', 0, 0, 'info@arucad.edu.tr', '+90 392 650 65 55', 'https://arucad.edu.tr/', 'arucad', 247, NULL, NULL),
(3, 'BAU Cyprus', 'Bahçeşehir Cyprus University (BAU Cyprus) initiated education in the 2017-2018 academic year\nafter receiving permission from local authorities for its establishment in 2016 to offer outstanding\neducational programmes and to provide an embracing environment for academic creativity and the\ndevelopment of leadership skills, instilling the concept of social responsibility, while respecting\ndiversity and multicultural understanding. BAU Cyprus is officially recognised by the Turkish Higher\nEducation Council (YOK) in Turkey, while all the programmes are accredited by the National\nEducation and the Higher Education Accreditation Commission (YODAK) of the Turkish Republic of\nNorthern Cyprus.<br><br> BAU Cyprus is a member of the BAU Global Education Network, which is comprised of several universities, Bahçeşehir University – Istanbul (main headquarter), Bay Atlantic University – Washington, Berlin International University of Applied Sciences – Berlin, BAU International University Batumi – Batumi, and Bahcesehir Cyprus University, Nicosia, which educate students from around the world in different undergraduate and graduate programmes.', 'data:image/png;base64,', '', 0, 0, '', '0', '', 'bau', 247, NULL, NULL),
(4, 'Cyprus International University', 'Cyprus International University is governed by the Rectorate. The Rectorate not only leads but also represents the university externally and coordinates the cooperation of university members internally. The Rectorate consists of the Rector, Vice-Rectors, and General Secretary. The Rector is the Chair of the Rectorate and the spokesperson for both the Rectorate and the University.<br><br>Starting with 81 students and 45 staff in 1997, CIU has grown exponentially reaching 14,000 students and more than 1000 staff in 28 years. We are committed to advancing in academic excellence, encourage sustainable development, engage in continuous innovation, and to create a diverse community by empowering students to continue to achieve and pursue lifelong success.', 'data:image/png;base64,', '', 0, 0, '', '0', '', 'ciu', 247, NULL, NULL),
(5, 'Cyprus Science University', 'Cyprus Science University was established in 2013. Following the establishment, our university experienced rapid growth in a short term. By 2014 the university started to accept students, and in a very short time the university got recognition by TRNC, Turkey and overseas, and became a preferred higher education institution.<br><br>Our campus is located within the boundaries of Ozank?y on the road of Bellapais, which is known as the most exceptional neighborhood in Kyrenia the most beautiful city of TRNC.<br><br>The superior qualifications of the administrative and academic staff, the excellence of classrooms developed laboratories and social venues, in addition the central location with everything around makes the university a preferred choice by prospective students.<br><br>Every effort has been made by Cyprus Science University which is located in the heart of the city center is being made to ensure that it has a distinguishing quality that makes a difference in terms of educational quality.', 'data:image/jpeg;base64,', '', 0, 0, '', '0', '', 'csu', 247, NULL, NULL);
INSERT INTO `universities` (`id`, `university_name`, `description`, `logo`, `location`, `rating`, `student_count`, `email`, `phone`, `website`, `slug`, `country_id`, `created_at`, `updated_at`) VALUES
(6, 'Cyprus West University', 'Cyprus West University aims to be a distinguished and respected member of the ever-evolving higher education ecosystem in Northern Cyprus. The Ministry of National Education of the Turkish Republic of Northern Cyprus (TRNC) approved its establishment on December 8, 2015, under the name ?Y?ksek Bilim ?niversitesi? (High Science University), and granted preliminary authorization for six undergraduate programs across three faculties.<br><br>Teaching at Cyprus West University officially began in the 2018-2019 academic year. During this period, program preliminary approvals were obtained for the law and psychology departments. To determine the English proficiency level of students admitted to English-taught programs and to provide necessary support for those in need, a School of Foreign Languages was established, and preliminary authorization was obtained for the launch of an English Preparatory Program.', 'data:image/jpeg;base64,', '', 0, 0, '', '0', '', 'cwu', 247, NULL, NULL),
(7, 'Eastern Mediterranean University', 'EMU is a full member of the International Association of Universities, the European University Association, Community of Mediterranean Universities and the Federation of the Universities of the Islamic World. Giving special importance to international recognition, EMU has received the accreditation of various prominent international accrediting bodies. EMU is only one of five universities in the region to have been awarded the prestigious ABET (Accreditation Board of Engineering and Technology) in the field of engineering.<br><br>Similarly, EMU Architecture Faculty holds the M?AK accreditation. Business and Economics Faculty, Tourism Faculty and School of Computing and Technology have been granted the accreditation of FIBAA. Education Faculty English Language Teaching (ELT) Department was accredited by AQAS. Additionally, EMU School of Tourism and Hospitality Management gained the accreditation of TEDQUAL and the Computer Technologies and Information Systems offered by School of Computing and Technology (SCT) successfully passed ASIIN accreditation process. EMU Foreign Languages and English Preparatory School has successfully obtained EDEXCEL accreditation.', 'data:image/png;base64,', '', 0, 0, '', '0', '', 'emu', 247, NULL, NULL);
INSERT INTO `universities` (`id`, `university_name`, `description`, `logo`, `location`, `rating`, `student_count`, `email`, `phone`, `website`, `slug`, `country_id`, `created_at`, `updated_at`) VALUES
(8, 'European Leadership University', 'European Leadership University (ELU) is internationally accredited by the Accreditation Service for International Schools, Colleges & Universities (ASIC). In addition to the international accreditation, European Leadership University (ELU) received its educational license in 2015 with the official decree and approval by the Ministry of Education and Culture in the Turkish Republic of Northern Cyprus. We have received Institutional accreditation in 2016 and achieved full programme accreditation in 2017 by the Higher Education Planning Evaluation, Accreditation and Coordination Council, Nicosia which is a member of The European Association for Quality Assurance in Higher Education (ENQA), the umbrella organisation for recognised government accreditation agencies in the European Higher Education Area (EHEA).', 'data:image/png;base64,', '', 0, 0, '', '0', '', 'elu', 247, NULL, NULL),
(9, 'Near East University', 'Near East University provides the best education and training environment for its distinguished students with 20 faculties, 196 undergraduate and associate degree programs, and 6 institutes offering 240 master\'s and doctorate programs, 3 high schools, 4 vocational schools, and 28 research centers. The scientific production and activities of Near East University are outstanding and constitute the basis of its greatness. For example, with the number of cited articles reaching 1,600 in 2021 Near East University produced 51 percent of the scientific articles produced by TRNC universities on its own.<br><br>In the, 2022 World Universities Impact Ranking list published by London-based Times Higher Education (THE), Near East University ranked 7th place in the world in terms of education quality and it is among the top 200 universities in the Sustainable Cities and Societies, category where cultural and artistic activity is assessed. Near East University is also included among the world\'s top 500 universities and ranks in the 151-175 band in Computer Sciences, and in the 176-200 band in, Engineering, in the 2023 World University Rankings list prepared by the London-based Times Higher Education (THE).', 'data:image/jpeg;base64,', '', 0, 0, '', '0', '', 'neu', 247, NULL, NULL),
(10, 'University Of Kyrenia', 'The University of Kyrenia was founded with the mission of ?training critical and innovative research-focused scholars, who will create knowledge and value in an international educational background and who will develop an appreciation of ethical and moral values, with a sense of social responsibility?. <br><br>The University of Kyrenia assumed full control of the Faculties of Maritime Studies, Maritime Management and Administration and Marine Sciences. It also took responsibility for the Marine Transportation and Management postgraduate program and all the Maritime Vocational School programs (with all their infrastructure and superstructure) from NEU. Working with an extant infrastructure of students and lecturers from the very start has given the University the edge in providing an ideal education with deep-rooted experience.', 'data:image/jpeg;base64,', '', 0, 0, '', '0', '', 'uok', 247, NULL, NULL);
INSERT INTO `universities` (`id`, `university_name`, `description`, `logo`, `location`, `rating`, `student_count`, `email`, `phone`, `website`, `slug`, `country_id`, `created_at`, `updated_at`) VALUES
(11, 'World Peace University', 'World Peace University was established under the auspices Alt?nba? Holding and Alt?nba? University shareholders. It is young. It has a dynamic administrative and academic staff. It?s established with the aim of becoming a fifth generation University. Education is a priority at the World Peace University. In this respect, it is a student-friendly and research-oriented University. It aims to educate its students on a campus (smart campus) equipped with superior technological infrastructure. In addition to education and research, our University follows a differentiated strategy in a cycle that uses, shares, structures and supervises the knowledge it produces.<br><br>We are passionate about collaborating with staff and students across the University to develop, improve, and implement communication, orientation, engagement and retention activities that help students achieve success.', 'data:image/jpeg;base64,', '', 0, 0, '', '0', '', 'wpu', 247, NULL, NULL);
